import React from "react";
import Navbar from "../Navbar"; // Adjust the path if needed
import "./home.css";

const Home = () => {
  return (
    <>
      <Navbar />
      <div className="home-container">
        <div className="content">
          <h1>Transform Task Management with Zidio</h1>
          <p>
            Harness Zidio Task Management to enhance efficiency and collaboration. 
            Our intuitive platform allows for effortless task organization, 
            real-time progress tracking, and seamless teamwork, enabling your 
            team to focus on achieving goals.
          </p>
        </div>
        <div className="image-container">
          <img src="/images/image.png" alt="Home" className="home-image" />
        </div>
      </div>
    </>
  );
};

export default Home;
